import React, { useEffect, useState } from 'react'
import axios from 'axios'

export const Business_Content = () => {
    
    const [ Supporting_Businesses_Page , update_Page] = useState(0)
    const [ Supporting_Businesses , update_Business] = useState()

    useEffect(()=>{
        axios.get('https://dummyjson.com/carts').then(
            (result)=>{

    return <React.Fragment>
                <li className='Business_icon_Components'> {result.data.carts[Supporting_Businesses_Page].id}</li>
                <li className='Business_icon_Components'> {result.data.carts[Supporting_Businesses_Page+1].id}</li>
                <li className='Business_icon_Components'> {result.data.carts[Supporting_Businesses_Page+2].id}</li>
                <li className='Business_icon_Components'> {result.data.carts[Supporting_Businesses_Page+3].id}</li>
                <li className='Business_icon_Components'> {result.data.carts[Supporting_Businesses_Page+4].id}</li>
                <li className='Business_icon_Components'> {result.data.carts[Supporting_Businesses_Page+5].id}</li>
                <li className='Business_icon_Components'> {result.data.carts[Supporting_Businesses_Page+6].id}</li>
                <li className='Business_icon_Components'> {result.data.carts[Supporting_Businesses_Page+7].id}</li>
            </React.Fragment>
            }).then((result)=>{
                update_Business(result)
            })
    },[])

    return(
        <React.Fragment>
        <div id='Three_instruction_Tab_Content_Support_Business_Part'>
            <div id='Business_icon_Container_Title'> Supporter Businesses </div>
            <div id='Business_icon_Container'>
                {Supporting_Businesses}
            </div>
            <div id='Business_icon_Container_Page_Manager'>
                <div> &lt; </div>
                {Supporting_Businesses_Page}
                <div> &gt; </div>
            </div>

        </div>
        </React.Fragment>
    )
}

export default Business_Content
